PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE docker_baseos_images (
                                        id integer PRIMARY KEY AUTOINCREMENT,
                                        container_name text NOT NULL,
                                        OS integer NOT NULL,
                                        Docker_URL  text NOT NULL,
                                        Notes text,
                                        CertOfImageAndPublisher text,
                                        Certification_Status text,
                                        OfficialImage text,
                                        VerifiedPublisher text,
                                        OpenShift_Correspondent_Image_URL text,
                                        OpenShiftStatus text,
                                        FOREIGN KEY (OS) REFERENCES entity_types (id)
                                    );
CREATE TABLE docker_images (
                                        id integer PRIMARY KEY AUTOINCREMENT,
                                        container_name text NOT NULL,
                                        OS integer NOT NULL,
                                        lang integer,
                                        lib integer,
                                        app integer,
                                        app_server integer,
                                        plugin integer,
                                        runlib integer,
                                        runtime integer,
                                        Docker_URL  text NOT NULL,
                                        Notes text,
                                        CertOfImageAndPublisher text,
                                        FOREIGN KEY (OS) REFERENCES entity_types (id),
                                        FOREIGN KEY (lang) REFERENCES entity_types (id),
                                        FOREIGN KEY (lib) REFERENCES entity_types (id),
                                        FOREIGN KEY (app) REFERENCES entity_types (id),
                                        FOREIGN KEY (app_server) REFERENCES entity_types (id),
                                        FOREIGN KEY (plugin) REFERENCES entity_types (id),
                                        FOREIGN KEY (runlib) REFERENCES entity_types (id),
                                        FOREIGN KEY (runtime) REFERENCES entity_types (id)
                                    );
CREATE TABLE entities (
                                        id integer PRIMARY KEY AUTOINCREMENT,
                                        entity_name text NOT NULL,
                                        entity_type_id integer NOT NULL,
                                        external_link text,
                                        FOREIGN KEY (entity_type_id) REFERENCES entity_types (id)
                                    );
CREATE TABLE entity_mentions (
                                        id integer PRIMARY KEY AUTOINCREMENT,
                                        entity_mention_name text NOT NULL,
                                        entity_type_id integer NOT NULL,
                                        entity_id integer NOT NULL,
                                        source text,
                                        FOREIGN KEY (entity_type_id) REFERENCES entity_types (id),
                                        FOREIGN KEY (entity_id) REFERENCES entities (id)
                                    );
CREATE TABLE entity_relations (
                                        id integer PRIMARY KEY AUTOINCREMENT,
                                        entity_parent_type_id integer NOT NULL,
                                        entity_parent_id integer NOT NULL,
                                        entity_child_type_id integer NOT NULL,
                                        entity_child_id integer NOT NULL,
                                        COTS text,
                                        FOREIGN KEY (entity_parent_type_id) REFERENCES entity_types (id),
                                        FOREIGN KEY (entity_child_type_id) REFERENCES entity_types (id),
                                        FOREIGN KEY (entity_parent_id) REFERENCES entities (id),
                                        FOREIGN KEY (entity_child_id) REFERENCES entities (id)
                                    );
CREATE TABLE entity_types (
                                        id integer PRIMARY KEY AUTOINCREMENT,
                                        entity_type_name text NOT NULL
                                    );
CREATE TABLE openshift_baseos_images (
                                        id integer PRIMARY KEY AUTOINCREMENT,
                                        container_name text NOT NULL,
                                        OS integer NOT NULL,
                                        OpenShift_Correspondent_Image_URL  text NOT NULL,
                                        Notes text,
                                        OpenShiftStatus text,
                                        DockerImageType text,
                                        FOREIGN KEY (OS) REFERENCES entity_types (id)
                                    );
CREATE TABLE openshift_images (
                                        id integer PRIMARY KEY AUTOINCREMENT,
                                        container_name text NOT NULL,
                                        OS integer NOT NULL,
                                        lang integer,
                                        lib integer,
                                        app integer,
                                        app_server integer,
                                        plugin integer,
                                        runlib integer,
                                        runtime integer,
                                        OpenShift_Correspondent_Image_URL  text NOT NULL,
                                        DockerImageType text,
                                        FOREIGN KEY (OS) REFERENCES entity_types (id),
                                        FOREIGN KEY (lang) REFERENCES entity_types (id),
                                        FOREIGN KEY (lib) REFERENCES entity_types (id),
                                        FOREIGN KEY (app) REFERENCES entity_types (id),
                                        FOREIGN KEY (app_server) REFERENCES entity_types (id),
                                        FOREIGN KEY (plugin) REFERENCES entity_types (id),
                                        FOREIGN KEY (runlib) REFERENCES entity_types (id),
                                        FOREIGN KEY (runtime) REFERENCES entity_types (id)
                                    );
CREATE TABLE operator_images (
                                        id integer PRIMARY KEY AUTOINCREMENT,
                                        container_name text NOT NULL,
                                        OS integer NOT NULL,
                                        lang integer,
                                        lib integer,
                                        app integer,
                                        app_server integer,
                                        plugin integer,
                                        runlib integer,
                                        runtime integer,
                                        Operator_Correspondent_Image_URL text NOT NULL,
                                        Operator_Repository text,
                                        FOREIGN KEY (OS) REFERENCES entities (id),
                                        FOREIGN KEY (lang) REFERENCES entities (id),
                                        FOREIGN KEY (lib) REFERENCES entities (id),
                                        FOREIGN KEY (app) REFERENCES entities (id),
                                        FOREIGN KEY (app_server) REFERENCES entities (id),
                                        FOREIGN KEY (plugin) REFERENCES entities (id),
                                        FOREIGN KEY (runlib) REFERENCES entities (id),
                                        FOREIGN KEY (runtime) REFERENCES entities (id)
                                    );

CREATE TABLE docker_environment_variables(
                                        id integer NOT NULL PRIMARY KEY AUTOINCREMENT,
                                        Environment_Variables text,
                                        Container_Name text,
                                        Required  text,
                                        Default_Values text,
                                        FOREIGN KEY (Container_Name) REFERENCES docker_images (id)
                                    );
CREATE TABLE entity_versions (
                                        id integer PRIMARY KEY AUTOINCREMENT,
                                        entity_id integer NOT NULL,
                                        version text,
                                        release_date date,
                                        end_date date,
                                        cost integer,
                                        FOREIGN KEY (entity_id) REFERENCES entities (id)
                                    );
DELETE FROM sqlite_sequence;
COMMIT;
